import React from "react";
import { Link, useNavigate } from "react-router-dom";
import "./Ourteam.css";
import { FaDatabase, FaCode, FaPaintBrush, FaProjectDiagram, FaLaptopCode } from "react-icons/fa";

const teamMembers = [
  { name: "Alice Johnson", role: "Project Leader", icon: <FaProjectDiagram size={50} /> },
  { name: "Bob Smith", role: "Backend Developer", icon: <FaDatabase size={50} /> },
  { name: "Charlie Brown", role: "Frontend Developer", icon: <FaLaptopCode size={50} /> },
  { name: "David Lee", role: "UI/UX Designer", icon: <FaPaintBrush size={50} /> },
  { name: "Emma Wilson", role: "Database Administrator", icon: <FaCode size={50} /> },
];

const OurTeam = () => {
  const navigate = useNavigate();

  // Function to navigate home and scroll to top
  const handleHomeClick = () => {
    navigate("/"); // Navigate to Home (LandingPage)
    setTimeout(() => {
      window.scrollTo({ top: 0, behavior: "smooth" });
    }, 100); // Delay to ensure the page is fully loaded before scrolling
  };

  // Function to navigate to About section
  const handleAboutClick = () => {
    if (window.location.pathname === "/") {
      setTimeout(() => {
        const aboutSection = document.getElementById("about-section");
        if (aboutSection) {
          aboutSection.scrollIntoView({ behavior: "smooth" });
        }
      }, 100);
    } else {
      navigate("/");
      setTimeout(() => {
        const aboutSection = document.getElementById("about-section");
        if (aboutSection) {
          aboutSection.scrollIntoView({ behavior: "smooth" });
        }
      }, 500);
    }
  };

  return (
    <>
      <div className="our-team-container">
        <h2>Say Hi!</h2>
        <div className="team-grid">
          {teamMembers.map((member, index) => (
            <div key={index} className="team-member">
              <div className="icon-container">{member.icon}</div>
              <h3>{member.name}</h3>
              <p>{member.role}</p>
            </div>
          ))}
        </div>
      </div>

      <footer className="footer-container">
        <div className="left">
          <span className="brand-name">trackfit.</span>
        </div>
        <div className="right">
          <div className="column">
            <h3>Home</h3>
            <ul>
              <li><Link to="/" onClick={handleHomeClick}>Home</Link></li>
              <li><Link to="/" onClick={handleAboutClick}>About</Link></li>
              <li><Link to="/Contact">Contacts</Link></li>
              <li><Link to="/signup">SignUp</Link></li>
            </ul>
          </div>
          <div className="column">
            <h3>FAQs</h3>
            <ul>
              <li><Link to="/FAQ">FAQs</Link></li>
              <li><Link to="/TOS">TOS</Link></li>
              <li><Link to="/Support">Support</Link></li>
              <li><Link to="/ReportBugs">Report Bugs</Link></li>
            </ul>
          </div>
        </div>
      </footer>
    </>
  );
};

export default OurTeam;
